import './App.css';
import Navbar from './components/Navbar';
import Products from './components/Products';
import Footer from './components/Footer';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route exact path="/" element={<Products />} />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
